export const updateEntryField = (command) => {
   console.log('UPDATING' + command)
   return {
      type: "UPDATED_COMMAND",
      command
   }
} 

export const submitEntryField = (command) => {
   console.log('SUBMITTING' + command)
   return {
      type: "SUBMITTED_COMMAND",
      command
   }
}
